import React from 'react';
import { Helmet } from 'react-helmet';

import { Footer, Landing, About, Skills, Education, Blog, Contacts, Projects } from '../../components';
import { headerData } from '../../data/headerData';

function Main() {
	return (
		<div>
			<Helmet>
				<title>{headerData.name} - Porfolio</title>
			</Helmet>

			{/* <Navbar /> */}
			<Landing />
			<About />
			<Education />
			<Skills />
			{/* <Experience /> */}
			<Projects />
			{/* <Achievement /> */}
			{/* <Services /> */}
			{/* <Testimonials /> */}
			<Blog />
			<Contacts />
			<Footer />
		</div>
	);
}

export default Main;
